function Favourites(){
    let elems=[]
    let newelems=[];
    for(let session in sessionStorage){
        elems.push(sessionStorage.getItem([session])) 
    }
    for(let i of elems){

        if (i!=null){
           for(let t in JSON.parse(i)){
            console.log( new DOMParser().parseFromString(JSON.parse(i)[t],"text/html").getElementsByName('body').children)
            newelems.push(JSON.parse(i)[t])
           }
            
        }
        
       
           
    }
    console.log(newelems,elems)
    return <div>{newelems}</div>
    }
    export default Favourites;
